import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Sidebar from "./front-end/components/Sidebar";
import Dashboard from "./front-end/pages/dashboard/Dashboard";
import Financeiro from "./front-end/pages/financeiro/Financeiro";
import Funcionarios from "./front-end/pages/funcionarios/Funcionarios";
import Obras from "./front-end/pages/obras/Obras";
import Orcamentos from "./front-end/pages/orcamentos/Orcamentos";
import Relatorios from "./front-end/pages/relatorios/Relatorios";
import Configuracoes from "./front-end/pages/configuracoes/Configuracoes.js";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="app">
        <Sidebar />
        <div className="content">
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/usuarios" element={<Funcionarios />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
